import React from "react";
import NavBar from "./componets/NavBar";
import EmployeInfoCall from "./componets/EmployeInfoCall";

import "./App.css";

export default function App() {
  useEffect(() => {
    Axios.get("https://randomuser.me/api/?results=50").then(res =>
      setData(res.data)
    );
  }, []);
  return (
    <div>
      <NavBar />
      Employee Directory
      <EmployeInfoCall />
    </div>
  );
}
